import React from 'react';

const Navbar = () => {
  return (
    <div className="container">
      <nav
        className="navbar navbar-light"
        style={{ backgroundColor: '#e3f2fd' }}
      >
        <h2>TodoApp</h2>
      </nav>
    </div>
  );
};

export default Navbar;
